INSERT INTO `activity` VALUES (3,'双十一团购会','/upload/activity/20171107/f035d9047e595354f46c7b628d9ce522.jpg','/upload/activity/20171107/4619b48d22a968a6ace5202b4711f455.jpg',1,1509897600,1510329600,'十里河五环大酒店',2,'55家会员双十一团购会，十里河五环大酒店，各大品牌参与团购活动，优惠多多，现场赠送优惠券。',1510036242,1510285636,0,'',1,0,''),(4,'公益验房','/upload/activity/20171107/3ec0ecf79c4fea9433407394836038c0.jpg','/upload/activity/20171107/de3704e0110ae2552890d86ffcd48db7.jpg',1,1509897600,1510934400,'北京四季怡园',3,'公益验房，专业看房。',1510037187,1510285632,0,'',1,0,''),(5,'双十一优惠团购会','/upload/activity/20171108/68e6b31dc9ba1b69cfbaade15b708409.jpeg','/upload/activity/20171107/7fa829416d6945fc8a91c6e72482225e.jpg',1,1509897600,1510416000,'北京十里河大酒店',2,'55家会员特权补贴券:\r\n55家会员特权补贴券面额300元和500元:\r\n领取方式：凭购房合同首页照片以及本人身份证原件和互动吧报名截图，11号活动现场9点半开始领取，每户限一张，多领无效。200份先到先得领完为止！此券是11号团购价格基础上使用！\r\n参团福利\r\n1、商家价格为何能做的更低？活动成本最小化，无高档酒店无砍价师！节约的成本直补55会员！\r\n2、55家居云集新老小区众多网友一起开团，销量决定价格，单独一户和千户一起购买价格肯定不同，这就是为什么要有组织性！\r\n3、每期活动您一定可以收获装修有关的知识，有资深设计讲解装修设计，也有资深装修专家和55BBS装修达人分享干货。\r\n4、由于价格是敏感信息，亲们可以先比价后参团，事事做到心中有数，件件都能放心团购。商家折扣一经举报，必须在原来基础上再让利给55会员！\r\n5、依托55BBS强大监督平台，业主消费有保障。下单，零风险。无论您是在平台下单，还是在线上下单或是拨打我们的团购电话抢先订购的，对于任何品牌，只要没有提供上门服务，只要是您通过55家居平台下订，有平台官方订单，就可以一分不少的归还给您。',1510037684,1510285627,0,'现金补贴券',1,0,''),(6,'55家第一期线下沙龙来啦','/upload/activity/20171120/107c8252c867ce6ad571ff19cc63ff81.jpg','/upload/activity/20171120/4b75616a4e20289673b85cc250bf6dd8.jpg',1,1510848000,1512144000,'北三环蓝景丽家负一层会议室',60,'非常感谢支持55家居的会员朋友，经广大网友强烈要求组织线下沙龙，面对面来一场别开生面、大咖倾力巨献的坐谈会。\r\n\r\n就在12月2日，55家第一期线下沙龙开始了！\r\n从材料到施工，一场精彩绝伦的装修菜鸟蜕变华章！\r\n不但谈情还要讲钱，一场连吃带拿的装修盛宴！\r\n品牌BOSS特权福利现场送不停，装修为您省钱不断……\r\n\r\n签到送好礼\r\n百亚甲醛治理提供的空气甲醛自测盒\r\n\r\n\r\n时间：12月2日13:30-16:30\r\n地点：北三环蓝景丽家负一层会议室\r\n主办方：55家居\r\n本场大佬：……………………………………\r\n活动亮点：\r\n●面对面听专家讲解，装修方案功能疑难解答\r\n●品牌老总现场送福利，装修又省一笔\r\n活动时间安排：\r\n13:30签到\r\n13:30—14:30装修干货分享\r\n14:30—15:30设计师案例讲解\r\n15:30—16:30互动时间\r\n微信报名咨询：加小嘿xiaohei55bbs\r\n电话报名咨询：13581523097\r\n场地有限，仅限50户，大家报名加快嗖嗖的来吧~\r\n\r\n乘车路线:\r\n地铁：13号线大钟寺A口出，过天桥步行450米左右\r\n公交:（395、300内蓟门桥西下）(84路地铁大钟寺下)',1510286997,1512096275,1,'非常感谢支持55家居的会员朋友，经广大网友强烈要求组织线下沙龙，面对面来一场别开生面、大咖倾力巨献的坐谈会。',1,0,'/upload/activity/20171125/f39ab7334d1f9c7a71af71b658e88f46.jpg'),(7,'不只是今天','/upload/activity/20171121/3e734dfc8ee56a28d144a990091f50eb.jpg','/upload/activity/20171121/5931a5e87b69d02c59c915c7e1564010.jpg',1,1511107200,1511539200,'北京大兴区嘉悦广场2号楼888',0,'<img  src=\'../updload/jjj.png\' />',1511243596,1511248097,0,'<img  src=\'../updload/jjj.png\' />',1,0,''),(8,'现在验房','/upload/activity/20171125/1368bcb57f5adaa203d130b63b1d6bfe.jpg','/upload/activity/20171124/0ec1742d4782ccdb08446ca7e40c9072.jpg',1,1511366400,1511798400,'',1,'“发布审核”是指由用户发起，将其完成初始化开发的小程序提交至腾讯，由腾讯自行或委托第三方对该小程序的合法性、合理性、安全性、稳定性、可操作性、用户体验等各方面，采用包括但不限于开发信息核对、安全测试、UI测试、随机测试、动态测试、安全测试等方式，进行审查、甄别、试验与评估的过程。发布审核结果包括审核通过与审核不通过两种。审核不通过的，该小程序将无法发布。 ',1511517202,1511592446,0,'“发布审核”是指由用户发起，将其完成初始化开发的小程序提交至腾讯，由腾讯自',2,12,''),(9,'yanfangguole','','/upload/activity/20171124/f36575e1a5d7bd3d4e995c49329c4ed7.jpg',1,1509552000,1510243200,'',0,'微信应用号（小程序，「应用号」的新称呼）终于来了！目前还处于内测阶段，微信只邀请了部分企业参与封测。想必大家都关心应用号的最终形态到底是什么样子？怎样将一个「服务号」改造成为「小程序」？我们暂时以一款简单的第三方工具的实例，来演示一下开发过程吧。 \r\n\r\nOK，为了让大家尽快看到这份教程，博卡君注定要熬夜了！今晚开始更新，希望明天一早就能发布第一篇教程！记录开始！看看几天能完成变身吧！ \r\n\r\n序言 ',1511517488,1511592450,0,'微信应用号（小程序，「应用号」的新称呼）终于来了！目前还处于内测阶段，微信只邀请了部分企业参与封测。想必大家都关心应用号的最终形态到底是',2,0,''),(10,'lishiyanfang2','','/upload/activity/20171124/c900f447442821f18c2454e34f88a592.jpg',1,1509638400,1510070400,'',0,'\r\n我们需要通过开发者工具，来完成小程序创建和代码编辑。 \r\n\r\n开发者工具安装完成后，打开并使用微信扫码登录。选择创建「项目」，填入上文获取到的 AppID，设置一个本地项目的名称（非小程序名称），比如「我的第一个项目」，并选择一个本地的文件夹作为代码存储的目录，点击「新建项目」就可以了。 \r\n\r\n为方便初学者了解微信小程序的基本代码结构，在创建过程中，如果选择的本地文件夹是个空文件夹，开发者工具会提示，是否需要创建一个 quick start 项目。选择「是」，开发者工具会帮助我们在开发目录里生成一个简单的 demo。 ',1511517579,1511592453,0,'本文档将带你一步步创建完成一个微信小程序，并可以在手机上体验该小程序的实际效果。这个小程序的首页将会显示欢迎语',2,0,''),(11,'【恒大名都】小区公益验房火热报名中！','/upload/activity/20171125/6d212fac37e0a8687d317647581591cc.jpg','/upload/activity/20171125/3803ba16fc4daf617b01342a9c39d3ba.jpg',1,1511539200,1514649600,'',1,'【恒大名都】小区公益验房火热报名中！\r\n\r\n恒大名都要收房的业主们注意咯！\r\n55家送福利啦！\r\n55家2017专家公益验房活动开始报名啦！\r\n新房拿到手可是不知道质量好不好？不用怕! 专家现场检测让您有坚实的后盾，保障您的权利。让验房“小白”也能轻松搞定质量检测。\r\n只要您是快收房，就可以报名验房，验房当天只需要您把大门打开即可~~~\r\n公益验房的基本原则是三公：公益、公正、公开\r\n公益验房内容：\r\n1．详细检验房屋质量：包括地面，墙面，顶面，水路，电路，门，窗，暖气，防水等等。\r\n2．专业人士亲临现场，与您面对面的交流沟通，为您的居室出谋划策。\r\n活动须知：\r\n1、参与人群：A、恒大名都准收房业主    B、北京其它准备收房的小区业主\r\n2、 活动时间：2017年（以小区实际收房时间为准）具体时间另行通知，敬请关注\r\n3、验房资格：本小区有5户以上的业主报名验房才算有效申请。我们会根据情况和时间进行统一的验房活动\r\n业主验房须知：\r\n1、申请验房的业主现场需携带纸和笔，用于记录现场专家发现的问题和讲解的知识。（如果业主有相应专业设备也可以带到现场） \r\n2、验收时要求业主全程陪同，新房验房时不得出现其他的验收组织验收、设计师或者施工队现场测量等行为，专家组有权拒绝提供新房或装修质量验收帮助。\r\n 3、业主需允许“专家公益验收团”的报道人员及参与现场学习的其他业主现场拍摄及网络实况报道（含文字说明、房屋图片、人物照片）。\r\n活动流程：\r\n1：凡想参加本次公益验房活动的业主请先加客服微信：xiaosi55bbs,进入55家公益验房官方群\r\n2：在下方“验房报名”位置进行个人信息填写和提交工作。\r\n3：官方客服会与您取得联系，并进行验房时间和活动要求的沟通。\r\n4：活动当天报名参加验房的业主根据要求进行验房活动。     ',1511592901,1511943662,1,'【恒大名都】小区公益验房火热报名中！\r\n\r\n恒大名都要收房的业主们注意咯！\r\n55家送福利啦！\r\n55家2017专家公益验房活动开始报名啦！\r\n新房拿到手可是不知道质量好不好？不用怕! 专家现场检测让您有坚实的后盾，保障您的权利。让验房“小白”也能轻松搞定质量检测。',2,2,'/upload/activity/20171125/b07e36f3f3c20a7c6491efa6cfab2dbf.jpg'),(12,'业之峰装饰大型专场（留筑2017）震撼来袭','/upload/activity/20171127/3124f05d5e3c5bb340051ba9c0a23c96.jpg','/upload/activity/20171127/33a88db4ce69144edf751d974c212f60.jpg',1,1511712000,1513353600,'北京市朝阳区东三环南路100号船舶重工酒店内（十里河桥东北角）三层宴会厅',3,'',1511765914,1512095544,1,'',1,0,'/upload/activity/20171128/af142dd7dcc212a22f73659bc143d144.jpg'),(13,'55“家”年华，吃喝嗨不停','/upload/activity/20171208/eb0522dabeb1bd5d85dd31b98158d05a.jpg','/upload/activity/20171208/137224fc97f24c37249b140cacf0e4cc.jpg',1,1512662400,1514822400,'',6,'亲爱的邻居们，2017年的元旦即将到来，大家一直线上聊天，还没有机会线下相聚，为了让大家更熟悉，咱们群里计划来一场吃喝聚会，我们为大家订饭菜，坐在一起聚聚，吃点，喝点，侃侃大山……\r\n',1512717617,1512718120,1,'',1,0,''),(14,'33333','/upload/activity/20171218/1b4a98c374a287135b3f53c59af4ca69.jpg','',1,1513526400,1513699200,'33333',1,'33333333',1513568311,1513747505,0,'333333',1,0,''),(15,'亚林上苑（亚五）逛店活动报名开始了！！！','/upload/activity/20171225/68d2c225a5d19be0baf68b3162cf55b7.jpg','/upload/activity/20171225/bf84cd51a91875ee5dc0bd18b2fb8e27.jpg',1,1514131200,1514563200,'十里河地铁站A口集合',30,'集合时间：2017.12.30上午9:30—10:00开始\r\n活动时间：2017.12.30上午10：00－15:00（提供午餐）\r\n地铁接待：十里河地铁Ａ口有班车接送\r\n指路电话：15701260360/13581523097\r\n啦啦啦…注意啦！公益活动逛起来……\r\n　　随着亚五小区收房越来越近，邻居们也开始研究自己新家装修的具体事项了，在畅想将来小家能装成什么样子的同时，也为要买什么样的产品，怎么挑适合自己的产品而发愁；装修互助群近一段时间一直在给大家分享相关的知识，不过都停留在理论上，本周六我们带大家到实体店面实践。从理论走到实践来，邻居们抓紧报名。本次活动只限３０户。\r\n      本次逛店学习产品有磁砖、厨柜、新风、烟机灶具，防盗门等，需要更多的可以随时告知团长。\r\n特殊福利：参与本次活动的３０户邻居将获得５５公益验收小组帮助，收房时免费陪同大家验收新房－－门窗、水电、入户门、空鼓、地面平整度等相关事项。\r\n往期逛店活动：\r\n',1514194735,1514357027,1,'集合时间：上午9:30—10:00开始\r\n活动时间：上午10：00－15:00（中间有午餐）\r\n地铁接待：十里河地铁Ａ口有班车接送\r\n指路电话：15701260360/13581523097',1,28,'/upload/activity/20171225/747717278a42faff268081a6d3558d20.jpg');
