INSERT INTO `article` VALUES (1,1,'baike1','/upload/article/20171110/b9adc57abcd5f60b17678bbd2c5dafe9.jpg','adasgadgs','',1,1,1,0,1510284763,1510284763,1,0,NULL),(2,64,'baike1','/upload/article/20171110/6964be2744a3dccc2791f7f4b9150d4f.jpg','asdgadsg','',1,1,0,1,1510284889,1510286047,1,0,NULL),(3,65,'如何选择设计师','/upload/article/20171110/d36df650878b12ea972016fb01d7701c.jpeg','设计师不是来帮你省钱，满足你无限欲望带你装B带你飞的。设计师是在你预想的基础上给出一个合理，适度，满足预算条件且可实施的方案以及实施计划并最终实现的人。\r\n外行人来鉴别设计师水平是很难的，要想找一个靠谱点的设计师难上加难的事情。\r\n不管是设计还是施工，你得靠自己。 “舒适”是你的核心诉求对吧，好，牢牢抓住这个点，在有限的”资金”和“筛选设计师和装修公司的时间精力成本”以及“效果”方面，要做好平衡。\r\n就像街边小店和米其林餐厅，可能都能吃饱，但是用餐体验上肯定是有区别的\r\n设计师还是要谈的，你要表达清楚你的核心诉求是“舒适”，跟你大谈风格，品味啊什么的可以pass掉了，能从空间，成本方面给出具体建议的设计师才是你该继续谈的对象——说实话这点不容乐观。\r\n在预算不足的情况下，巧妇难为无米之炊，设计师可以帮你避免不合理的浪费达到省钱的目的，但是不能强行把材料变廉价。\r\n如果找不到这样的，你只能退而求其次找那么一个相对”实在”点的。在你这个房子级别上面，有”责任心”是比“有实力”更优先选项——装饰公司同理。\r\n我会告诉你在“空间”，“结构”方面好多设计师自己都是一团浆糊吗？不要把建筑师和室内设计师混为一谈哦，当然我也不会告诉你他们中好多人搞设计跟你写论文是一样的套路。\r\n重装饰轻装修如果要保证设计度和耐看方面的需求，软装是要一定时间就更换的\r\n我无异攻击那些优秀的设计师，这个行业乱像是事实，也并非全是设计师个人的原因。\r\n这个户型怎么改，还是自己家人多商量，再和设计师多商量，这方面给不了具体的建议——毕竟非专业。\r\n说了这么多好像还没答到点子上，我的建议是，先多谈几家，再来决定是否自己操刀。至于”省钱”，千万别拿”非物质成本”不当钱。\r\n设计费的高低取决于你所选的公司及设计师等因素，标准的设计费就能满足你平常正常使用了，需求更多则需要付出更多。但不同档次的基础设计费会体现在最终效果上。\r\n在预算有限且这个预算并不能足够覆盖设计费与达成该设计的情况下最实惠的办法是自己多看经验贴，自己弄，但肯定会有一定合理性的欠缺而且比较累。\r\n而最出设计感的办法是选择一家适合需求和预算的公司以轻度装修后期配饰来提现方案，但是同样需要你自己付出时间和精力，并且这是长期的。\r\n设计师的作用体现在把你的想法转化成合理实用的现实，但不能凭空变出来。并且大体上遵循一份钱一份人。\r\n你主要考虑财务问题，报出你的预算，让他给你出方案和看他以前差不多价位的预算做出来的方案。\r\n你主要考虑设计感，设计师的时候先看他最得意的方案，让他谈谈这么设计的理念，根据你的爱好，设计出满意的方案，不然很难谈得下去。\r\n无良坑爹的公司和设计师是存在的，而好的设计从不廉价，人品也一样。\r\n','',1,1,0,1,1510286439,1510625616,1,0,NULL),(4,66,'床垫的那些学问！！！','/upload/article/20171110/477d79f8b5acf2d302c5b4c489f68be0.jpeg','小编有些朋友是做床垫的，床垫这行业水真的很深，经常开他们的玩笑，说是：你们太黑了。（哈哈）黑的原因有两个，一个是把简单的商品复杂化，包装了很多概念迷惑消费者。另外一个是利用消费者的心理去把商品高利润化。\r\n首先要在买西床垫知道床垫那些分类、材质、品牌。根据家里我的卧室，买多大的尺寸，在结合自己的需求，挑选适合的软硬度（舒适度和软硬度，软硬度≠硬）。最好做好预算，在预算之内买最好的。\r\n告诉大家一个残忍的事实，根据调查结果显示，无论你怎么试躺也是试不出来效果的。还是多多关心价格，材质，尺寸和软硬度吧！（福利呦）\r\n去买床垫的穿着很重要，摘掉所有能证明你很有钱的代表性的东西，简单、纯朴的着装。给导购制造一种假象，看不透你的底线。这样就有了砍价的主动权。\r\n到了店里先询问是不是全国统一售价，最低价格是多少和下次活动的时间、有没有赠品，赠品是什么。最好砍价的心理准备，是一种心理战术。导购会根据你的言谈举止、工作带判断有没有消费能力（少说些话吧），在预算之内的2-3家中选择，怎么选择呢？搜索下淘宝同款的最低价+运费x110%进行砍价，一般导购都会县套路拒绝，最后表现的很无奈的卖给您。不要以为这就是结束了，选好自己的赠品，带上回家（自己编些小故事吧）\r\n线上线下一定问清楚售后怎么服务，以哪种方式，发票留好。\r\n分割线\r\n床垫的谎言，切勿相信，在这里给大家解释下。\r\n硬床垫对身体好，有利健康。要根据身体的线条，需要床垫进行依托，因为怎么睡也是到不了一个平面上（平躺、侧卧）。\r\n过硬的床垫对身体不好\r\n床垫带有保健功能，更是不靠谱的说法，正规合格的床垫，性能不会差太多的。\r\n棕榈床垫取材于天然材料，所以更健康环保。这种材料的床垫保养不善，很容易滋生细菌，引起皮肤感染。','',1,1,0,1,1510286585,1510625611,1,0,NULL),(5,66,'床垫的那些学问！！！','/upload/article/20171110/ccdacb89625c624c8dd32c6d9a63b34c.jpg','小编有些朋友是做床垫的，床垫这行业水真的很深，经常开他们的玩笑，说是：你们太黑了。（哈哈）黑的原因有两个，一个是把简单的商品复杂化，包装了很多概念迷惑消费者。另外一个是利用消费者的心理去把商品高利润化。\r\n首先要在买西床垫知道床垫那些分类、材质、品牌。根据家里我的卧室，买多大的尺寸，在结合自己的需求，挑选适合的软硬度（舒适度和软硬度，软硬度≠硬）。最好做好预算，在预算之内买最好的。\r\n告诉大家一个残忍的事实，根据调查结果显示，无论你怎么试躺也是试不出来效果的。还是多多关心价格，材质，尺寸和软硬度吧！（福利呦）\r\n去买床垫的穿着很重要，摘掉所有能证明你很有钱的代表性的东西，简单、纯朴的着装。给导购制造一种假象，看不透你的底线。这样就有了砍价的主动权。\r\n到了店里先询问是不是全国统一售价，最低价格是多少和下次活动的时间、有没有赠品，赠品是什么。最好砍价的心理准备，是一种心理战术。导购会根据你的言谈举止、工作带判断有没有消费能力（少说些话吧），在预算之内的2-3家中选择，怎么选择呢？搜索下淘宝同款的最低价+运费x110%进行砍价，一般导购都会县套路拒绝，最后表现的很无奈的卖给您。不要以为这就是结束了，选好自己的赠品，带上回家（自己编些小故事吧）\r\n线上线下一定问清楚售后怎么服务，以哪种方式，发票留好。\r\n分割线\r\n床垫的谎言，切勿相信，在这里给大家解释下。\r\n硬床垫对身体好，有利健康。要根据身体的线条，需要床垫进行依托，因为怎么睡也是到不了一个平面上（平躺、侧卧）。\r\n过硬的床垫对身体不好\r\n床垫带有保健功能，更是不靠谱的说法，正规合格的床垫，性能不会差太多的。\r\n棕榈床垫取材于天然材料，所以更健康环保。这种材料的床垫保养不善，很容易滋生细菌，引起皮肤感染。','',1,1,0,0,1510286614,1510286620,1,0,NULL),(6,1,'团购','/upload/article/20171128/82015f6189cc9328fd1b4620a3459bb8.jpg','团购很划算','',1,1,1,0,1511858476,1511858476,3,0,1),(7,1,'1','/upload/article/20171129/713524bc9ff0e5a961caf1fa95e36cae.jpg','参团人数已满','',1,1,1,0,1511938189,1511938189,3,0,2),(8,1,'33','/upload/article/20171130/f7e743ca2528bdf05afe8867da0dbaac.jpg','44444','',1,1,1,0,1512008821,1512008821,3,0,5),(9,1,'gggg','/upload/article/20171218/c2815888d0b6c80c2a62262dc2867bc6.jpg','gggggg','',1,1,1,0,1513587759,1513587759,3,0,10),(10,1,'拼团成功结束','/upload/article/20171225/c14cc7930fe2e654deecdc3140d55244.jpg','拼团很成功','',1,1,1,0,1514170095,1514170095,3,0,7);
