8001职业健康安全管理体系认证，通过了国际轨道交通IRIS质量管理体系认证，通过了AS9100C版国际航空，以及TS16949国际汽车行业质量管理体系认证。通过了DNV（挪威船级社）合金产品认证、中国节能产品认证。获得了南车青岛四方机车车辆股份有限公司高速动车组和地铁项目《产品、服务供应许可证》，取得了唐山机车厂CRH3动车组项目合格供应商资质。获得有色金属实物质量金杯奖。“工欲善其事，必先利其器”。拥有目前世界上最完整铝产业链的南山人深谙此道。南山铝材拥有当今世界先进的挤压生产线及德国、美国、意大利、日本、瑞士等国际顶级配套设备。南山铝材公司将依托于南山铝业优势的铝产业链和深厚的企业文化，继续秉承“自强不息，奋进不止”的南山精神，以更优质的质量、更好的服务、更新的产品与社会各界携手并进、共创未来！',1,'南山断桥铝门窗',1,'',0.00,0.00,0.00,0.00,NULL,100000),(35,14,'欧派橱柜旗舰店','十里河居然之家欧派旗舰店','北京',51,'欧派全屋定制','18610845339',0,0,NULL,'/upload/shop/20171110/385cb8e5ca764b49fcc3df9fd5892e49.jpg','/upload/shop/20171110/5e6e5e322ffb2d1ecc72c6bae682c470.jpg','',1,1509594546,1510306600,'欧派家居集团股份有限公司创立于1994年，股票代码603833，是中国整体橱柜行业的领先品牌，拥有国际化家居产品制造基地。欧派以整体橱柜为龙头，带动相关产业发展，包括全屋定制、衣柜、卫浴、木门、墙饰壁纸、厨房电器、寝具等，形成多元化产业格局，是国内综合型的现代整体家居一体化服务供应商。',1,'欧派橱柜',1,'',0.00,0.00,0.00,0.00,NULL,100000),(36,12,'振生安防防盗门旗舰店','北京各建材城均有','北京',58,'振生安防全自动防盗门','17601682761',0,0,NULL,'/upload/shop/20171225/9c80d7a8550de91b07a7ec0950133216.jpg','/upload/shop/20171225/0432db4f59ca8a1469e32e06478d566c.jpg','',1,1509594719,1514166973,'振生安防全自动防盗门是一家及研发、生产、销售、服务于一体的安防公司，我们以品质大于品牌作为企业根本，执行国家标准，假一赔万，两项承诺：买门时不收定金不收全款，安装满意再付款；一年内无理由退门、换门、换锁芯，安装全免费！振生安防 中国服务',1,'振生安防防盗门',1,'',0.00,0.00,0.00,0.00,NULL,100000),(37,10,'凤铝门窗旗舰店','朝阳区十里河闽龙广场负二楼-58','北京',56,'徐玲','13681205322',49,39,NULL,'/upload/shop/20171102/d3e75bc042d250017ae7aeb26ad50215.jpg','/upload/shop/20171102/445f7d11c3c236ec62747f436323622c.jpg','',1,1509598511,1511339518,'我公司专业从事隔热断桥铝门窗、塑钢门窗、高档铝包木门窗 、阳光房 、封阳台 、露台、 等的制作、销售、安装服务为一体的现代化新型企业。创立于1998年，主要经营铝包木门窗，断桥铝门窗、塑钢门窗、高档阳光房、玻璃房。承接大小工程以及单户型家装门窗设计制做安装。先后在北京四惠，十里河等地区经营长达20年之久，赢得业主的广泛好评。随着市场经济改革的不断深化，随着家居环境越来越高端的需求，我们将慢慢走向网络，力求精益求精，在竞争中将不断更新理念，实行全方位现代化综合管理，将一如既往地向各位新老客户提供更满意的产品和更完善的售后服务。订购凤铝门窗享有以下免费政策\r\n（1) 免费测量、设计、报价\r\n（2）免费出专业门窗图纸\r\n（3) 免费送货、上楼、安装\r\n（4) 免费防水打胶服务\r\n（5)免费烟机打孔，不限个数\r\n（6）免费赠送窗户防撞护角\r\n关于质保，我们将提供5年质保，终身维护！联系电话 13618105322  18310715753',1,'凤铝门窗',1,'',0.20,0.00,0.10,0.00,NULL,100000),(38,7,'实拓装饰旗舰店','东亚五环国际3栋101室','北京',61,'北京实拓装饰有限公司','',67,52,NULL,'/upload/s