力，百亚生物已入住连云港生物科技园，成为园区重点扶持发展企业。 \r\n　　百亚生物秉持“以科技赢得未来”的理念，凭借持续不断的创新，致力于中国健康事业的发展，力争成为中国一流的室内环境健康事业的领跑者，一路前行，与您携手，共创辉煌。\r\n产品特效：\r\n（1）本产品是采用植物大分子材料经过相转移催化技术改性而成的生物清醛剂，改性后的产品安全环保，无腐蚀性，对生物体温和无刺激。\r\n （2）本产品使用后对甲醛捕捉力强，可以快速清除空气、地板、木门、木制家具、窗帘、布艺中的甲醛，可以在人造板的内部形成除醛膜，从源头上清除甲醛。\r\n （3）持久有效，室内温度稳定，湿度适宜，生物大分子具有持久的生物活性，可以持久清除甲醛。\r\n',0,'百亚甲醛治理',1,'01084707425',0.00,0.00,0.00,0.00,NULL,100000),(100,NULL,'搭窝旗舰店','','',61,'搭窝','',0,0,NULL,'/upload/shop/20171213/f982fd49cd5ed263aea81ad33f898db8.jpg','/upload/shop/20171213/e98ff3664e2bef3758f72bfc36529553.jpg','',0,1513135999,1513136233,'暂无描述',0,'搭窝',0,'',0.00,0.00,0.00,0.00,NULL,100000),(92,75,'松下新风旗舰店','北京市朝阳区广顺南大街33号','北京',60,'松下新风旗舰店','18612596561',0,0,NULL,'/upload/shop/20171124/bd2279c80b2a39e84bdd79cbb0c84293.jpg','/upload/shop/20171124/59ef864f61cec4fe506b6a1c3815636d.jpg','',1,1511488607,1512534668,'我公司成立于2000年。2005年开始与松下北京工厂合作。\r\n公司成立之初，正值民用新风系统引入国内。我们见证了中国国内家用新风系统市场的成长和发展。也跟世界知名品牌一道，为推广民用新风系统做出了我们的贡献。在销售世界知名厂商的产品的同时，我们也做了部分研发。我们用设计、施工、销售新风系统的经验来满足客户最大的需求。\r\n    近些年，雾霾肆虐，对新风系统提出了前所未有的要求，各个厂家的产品都面临升级换代。我们将与业内众多厂家一道，进一步完善主机的生产和研发，也会充分利用现有技术条件，设计出更适合用户需求的新一代新风系统。\r\n我们努力为用户营造一个舒适、健康的室内空气环境。\r\n',0,'松下新风',1,'',0.00,0.00,0.00,0.00,NULL,100000),(93,76,'家家鸿地板旗舰店','北五环红星美凯龙二层家家鸿地板','北京',49,'吕璐','13381139229',12,0,NULL,'/upload/shop/20171124/9359ddd2d3c4a3aecad44cda8016107a.jpg','/upload/shop/20171124/de1e28299e2efe46f17c5df2c8efee6d.jpg','',1,1511515397,1511746460,'家家鸿地板是众博成木业（北京）有限公司旗下以环境本色无漆原生态系列实木地板快速打入市场的一款品牌，以实木地板纯天然环保无甲醛，经过加工专门针对地暖地面进行二次高温处理，是用于地暖地面的首选材料，家家鸿地板是北京市木地板行业综合实力较强、发展速度最快的木地板制造企业之一。公司在浙江南浔拥有自己的木业加工厂，属于厂家直营，省去层层费用，把低价、品质带给百姓，符合现代化工薪阶层消费的主力品牌，目前2017年3月份在新化股权交易服务中心挂牌敲钟。',0,'家家鸿地板',1,'62250662',0.00,0.00,0.00,0.00,NULL,100000),(94,NULL,'老板电器','','',67,'','',0,0,NULL,'/upload/shop/20171125/0e82df4bb6c28aae7f7a5c9c86451f54.jpg','/upload/shop/20171125/890ba93c8ca10d823199e3657e7942c6.jpg','',2,1511593271,1512012246,'暂无描述',0,'老板烟机',0,'',0.00,0.00,0.00,0.00,NULL,100000),(95,NULL,'林内燃气热水器','','',67,'','',2,0,NULL,'/upload/s